export default{
    validationSchema(body){
        const schema = Joi.object().keys({
            employee_id:Joi.string().required(),
            req_id:Joi.string().required(),
            isActive:Joi.string(),
            created_dt:Joi.date(),
          
        });
        const {error,value} = Joi.validate(body,schema);
        if(error && error.details){
            return {error};
        }
        return{value};
        },
      
    }
